import React from 'react';
import { Container, Row, Col } from 'react-grid-system';




export default function dashboard () {

  return (

    <Container>
    <h1>Dash</h1>

    <Row>
      <Col sm={4}>
        One of three columns
      </Col>
      <Col sm={4}>
        One of three columns
      </Col>
      <Col sm={4}>
        One of three columns
      </Col>
    </Row>
  </Container>
  );
}
